import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

import App from './App';
import Game from './Game';

import './index.scss';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Game />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
